BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS `CountryDataEx` (
	`_id`	INTEGER PRIMARY KEY AUTOINCREMENT UNIQUE,
	`ARRLPrefix`	VARCHAR ( 5 ),
	`Comment`	VARCHAR ( 5 ),
	`Continent`	VARCHAR ( 2 ),
	`Country`	VARCHAR ( 40 ),
	`CQZone`	INTEGER,
	`DXCC`	INTEGER,
	`ITUZone`	INTEGER,
	`Latitude`	VARCHAR ( 8 ),
	`Longitude`	VARCHAR ( 9 ),
	`PrefixList`	VARCHAR ( 212 ),
	`Status`	VARCHAR ( 7 ),
	`StartDate`	VARCHAR ( 19 ),
	`TimeDiff`	INTEGER,
	`EndDate`	VARCHAR ( 19 )
);
COMMIT;
